import './App.css';
import Activity from './components/activity/Activity';
import Nav from './components/nav/Nav';
import Table from './components/table/Table';
import { temp } from './utils/temp.js'

export default function App() {
  let itemsActivities = temp.activities[0];


  console.log([...itemsActivities]);


  return (
    <>
      <Nav />
      <Activity />
      <Table
      description = {itemsActivities.description}
      disciplines = {itemsActivities.disciplines}
      scope = {itemsActivities.scope}
      Responsibility = {itemsActivities.Responsibility}
      timing = {itemsActivities.timing}
      />
    </>
  );
}
